import React, {Component} from 'react';
import {BrowserRouter as Router, Route, Link} from "react-router-dom";
// import {GetUserData, GetUser, Logout, SendTokenToServer} from "../User/UserFunctions.js"
import homebkgrnd from '../logoz.svg';
// import firebase from "../firebase.js";
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbarin from '../components/Navbarin.js';
import Navbarout from '../components/Navbarout.js';

//Landing page
export default class HomePage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            User: null,
            User_Loaded: false,
            User_Firstname: "",
            User_Lastname: "",
            User_Email: "",
            User_Friends: [],
            User_Token: "",
            User_Favorites: [],
            User_FriendsCnt: 0,
        };
    }

    LoggedInPage() {
        return (
            <div>
                <Navbarin handleLogout={this.handleLogout}/>
                <br />
                <div align='center'><h1>DJ-IRS</h1></div>
                <div align='center'><h4>Find new music. Make new friends.</h4></div>
                <br />
                <div align='center'><img src={homebkgrnd} width='500' height='300'/></div>

            </div>
        );
    }


    render() {
            return this.LoggedInPage();
    }
}
